import React from 'react';
import { BrowserRouter as Router,Switch, Rotue } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar'


function App() {
  return (
    <>
    <Router>
      <navbar/>
      <Switch>
        <Route path='/' exact/>
      </Switch>
    </Router>
    </>
  );
}

export default App;
